// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.0;
contract SelectDemo {

    event Log(bytes data);

    //当我们调用m1方法时，传递过去的完整参数会保存在msg.data全局变量中
    function m1(address _address)external  {
        emit Log(msg.data);
    }
}

